import storePromotion from "./storePromotion";
import newUserFreeGift from "./NewUserFreeGift";
import voteProducts from "./voteProducts";
import wishLocalPickup from "./wishLocalPickup";

export default [
  {...cashOnDelivery},
  {...storePromotion},
  {...newUserFreeGift},
  {...voteProducts},
  {...wishLocalPickup}
]
